import { Box, Button } from "@mui/material";
import MyButton from "./MyButton";

const OrderListFirst = ({ setPageNumber }) => {
  return (
    <Box sx={{ border: "1px solid black" }}>
      <MyButton
        value="다음"
        onClick={() => {
          setPageNumber(2);
        }}
      />
    </Box>
  );
};

export default OrderListFirst;
